export const RichContentPopoverComponent = () => {
  return (
    <Flex gap="8px" flexWrap="wrap">
      {/* User Profile Popover */}
      <Popover trigger={<Button>User Profile</Button>}>
        <h3
          style={{ fontWeight: '600', fontSize: '18px', marginBottom: '4px' }}
        >
          John Doe
        </h3>
        <p style={{ fontSize: '14px', color: '#6b7280', marginBottom: '16px' }}>
          Software Engineer
        </p>
        <div
          style={{
            display: 'flex',
            flexDirection: 'column',
            gap: '8px',
            marginBottom: '16px',
          }}
        >
          <p style={{ fontSize: '14px', color: '#6b7280' }}>
            john.doe@example.com
          </p>
          <p style={{ fontSize: '14px' }}>
            Passionate about creating beautiful user interfaces and solving
            complex problems.
          </p>
        </div>
        <Button size="sm" style={{ width: '100%' }}>
          View Profile
        </Button>
      </Popover>

      {/* Contact Form Popover */}
      <Popover
        trigger={<Button variant="outline">Contact Form</Button>}
        contentProps={{ side: 'bottom', align: 'center' }}
      >
        <h3
          style={{ fontWeight: '600', fontSize: '18px', marginBottom: '4px' }}
        >
          Quick Contact
        </h3>
        <p style={{ fontSize: '14px', color: '#6b7280', marginBottom: '16px' }}>
          Send us a message
        </p>
        <div
          style={{
            display: 'flex',
            flexDirection: 'column',
            gap: '12px',
            marginBottom: '16px',
          }}
        >
          <Input placeholder="Your name" />
          <Input placeholder="Email address" type="email" />
          <textarea
            style={{
              width: '100%',
              padding: '8px',
              border: '1px solid #d1d5db',
              borderRadius: '6px',
              resize: 'none',
            }}
            rows={3}
            placeholder="Your message"
          />
        </div>
        <div style={{ display: 'flex', gap: '8px' }}>
          <Button size="sm" style={{ flex: '1' }}>
            Send
          </Button>
          <Button size="sm" variant="outline" style={{ flex: '1' }}>
            Cancel
          </Button>
        </div>
      </Popover>
    </Flex>
  );
};
`})]}),DJ=[{property:"trigger",description:"The trigger element for the popover (e.g., a button).",type:"ReactNode",default:"-"},{property:"children",description:"The content to display inside the popover.",type:"ReactNode",default:"-"},{property:"triggerProps?",description:"Props to customize the Trigger component.",type:a.jsx(Ne,{children:"Trigger Props"}),default:"-"},{property:"contentProps?",description:"Props to customize the Content component.",type:a.jsx(Ne,{children:"Content Props"}),default:"-"},{property:"...popoverProps",description:"Other props are the same as the base <Popover> component from @radix-ui/react-popover.",type:"PopoverProps",default:"-"}],MJ=[{property:"className?",description:"Custom CSS class for the popover trigger.",type:"string",default:"-"},{property:"style?",description:"Custom inline style for the popover trigger.",type:"React.CSSProperties",default:"-"}],PJ=[{property:"side?",description:"The side of the trigger to render against. One of top, right, bottom, left.",type:'"top" | "right" | "bottom" | "left"',default:"bottom"},{property:"align?",description:"The alignment of the popover content relative to the trigger.",type:'"start" | "center" | "end"',default:"center"},{property:"sideOffset?",description:"The distance in pixels from the trigger.",type:"number",default:"0"},{property:"collisionPadding?",description:"The distance in pixels from the edge of the viewport.",type:"number | Partial<{ top: number; right: number; bottom: number; left: number }>",default:"8"},{property:"avoidCollisions?",description:"Whether to avoid collisions with the viewport edges.",type:"boolean",default:"true"},{property:"onOpenAutoFocus?",description:"Callback when the popover opens and receives focus.",type:"() => void",default:"-"},{property:"onCloseAutoFocus?",description:"Callback when the popover closes and focus is returned.",type:"() => void",default:"-"}],kJ=`
